import logo from "./logo.svg";
import "./App.css";

function App() {
  return <Layout />;
}

function Layout() {
  return (
    <div className="layout">
      <Header />
      <Form />
      <Todo />
      <List />
    </div>
  );
}

function Header() {
  return (
    <div className="header">
      <span>My Todo List</span>
      <span>React</span>
    </div>
  );
}
function Form() {
  return (
    <>
      <div className="form">
        제목 <input type="text" />
        내용 <input type="text" />
        <button className="add">추가하기</button>
      </div>
      <div>
        <span>Working..</span>
        <br />
        <span>Done..!</span>
      </div>
    </>
  );
}

function Todo() {
  return (
    <>
      <div className="todo">
        <h3>리액트 공부하기</h3>
        <span>리액트 기초를 공부해봅시다</span>
        <button>삭제하기</button>
        <button>완료</button>
      </div>
    </>
  );
}

function List() {
  return (
    <div className="list">
      <h3>리액트 공부하기</h3>
      <span>리액트 기초를 공부해봅시다</span>
      <button>삭제하기</button>
      <button>완료</button>
    </div>
  );
}

export default App;
